tinsert(l,m(213,g({lvl=13,description="Ragefire Chasm consists of a network of volcanic caverns that lie below the orcs' new capital city of Orgrimmar. Recently, rumors have spread that a cult loyal to the demonic Shadow Council has taken up residence within the Chasm's fiery depths. This cult, known as the Burning Blade, threatens the very sovereignty of Durotar. Many believe that the orc Warchief, Thrall, is aware of the Blade's existence and has chosen not to destroy it in the hopes that its members might lead him straight to the Shadow Council. Either way, the dark powers emanating from Ragefire Chasm could undo all that the orcs have fought to attain"},{n(-17,{q(5726,{coords={a11},qgs={4949},lvl=9,r=1}),q(5727,{coords={a11},qgs={4949},sourceQuests={5726},lvl=9,r=1}),q(5728,{coords={a11},qgs={4949},sourceQuests={5727},lvl=9,r=1}),q(5729,{coords={a11},qgs={4949},sourceQuests={5728},lvl=9,r=1}),q(5730,g({coords={{49.6,50.6}},qgs={3216},sourceQuests={5729},lvl=9,r=1},{i(15424),i(15445),i(15443),i(15444)})),q(5724,g({qgs={11834},sourceQuests={5722},lvl=9,r=1},{i(15452),i(15453)})),q(5722,{coords={{70.6,31.4}},qgs={11833},lvl=9,r=1}),q(5761,{coords={{49.6,50.6}},qgs={3216},sourceQuests={5727},lvl=9,r=1}),q(5723,{coords={{70.6,31.4}},qgs={11833},lvl=9,r=1}),q(5725,g({coords={{56.2,91.8}},qgs={2425},lvl=9,r=1},{i(15450),i(15451),i(15449)}))}),n(11517,{i(2589)}),n(11520,{i(14540),i(14145),i(14149),i(14148)}),n(11518,{i(14151),i(14150),i(14147)}),n(11519,{description="Drops nothing of note."})})));
tinsert(l,m(310,g({lvl=14,description="During the Third War, the wizards of the Kirin Tor battled against the undead armies of the Scourge. When the wizards of Dalaran died in battle, they would rise soon after - adding their former might to the growing Scourge. Frustrated by their lack of progress (and against the advice of his peers) the Archmage, Arugal elected to summon extra-dimensional entities to bolster Dalaran's diminishing ranks. Arugal's summoning brought the ravenous worgen into the world of Azeroth. The feral wolf-men slaughtered not only the Scourge, but quickly turned on the wizards themselves. The worgen sieged the keep of the noble, Baron Silverlaine. Situated above the tiny hamlet of Pyrewood, the keep quickly fell into shadow and ruin. Driven mad with guilt, Arugal adopted the worgen as his children and retreated to the newly dubbed 'Shadowfang Keep'. It's said he still resides there, protected by his massive pet, Fenrus - and haunted by the vengeful ghost of Baron Silverlaine."},{n(-17,{q(1014,g({coords={{44.2,39.8}},qgs={1938},lvl=18,r=1},{i(6414)})),q(1098,g({coords={{43.4,40.8}},qgs={1952},lvl=18,r=1},{i(3324)})),q(1013,g({coords={{54,54.6}},qgs={2934},lvl=16,r=1},{i(4534),i(6335)})),q(1740,g({coords={{49.2,57.2}},qgs={6247},lvl=20,c=a2},{i(6898),i(15109)})),q(1794,{coords={{23.6,6.4}},qgs={5149},lvl=20,c=a1,races=a4}),q(1793,{coords={{39.8,30.8}},qgs={6171},lvl=20,c=a1,races=a5}),i(6776,{sourceQuests={1793,1794},coords={{39.8,30.8}},questID=1649,qgs={6171},lvl=20,c=a1,races=a10}),q(1650,{coords={{39.8,30.8}},qgs={6171},sourceQuests={1649},c=a1,races=a10,lvl=20}),q(1651,{coords={{42.4,88.4}},qgs={6182},sourceQuests={1650},c=a1,races=a10,lvl=20}),q(1652,g({coords={{39.8,30.8}},qgs={6171},sourceQuests={1651},c=a1,races=a10,lvl=20},{sp(5502),i(9607)})),q(1653,{coords={{39.8,30.8}},qgs={6171},sourceQuests={1652},c=a1,races=a10,lvl=20}),q(1654,{coords={{52.6,36.8}},qgs={6181},sourceQuests={1653},c=a1,races=a10,lvl=20}),q(1806,g({coords={{52.6,36.8}